const Card = (props) => {
    return(
        <div>
            <p>Nombre:{props.name}</p>
            <p>Image:{props.image}</p>
            <p>Temperamento:{props.temperament}</p>
            <p>Peso:{props.weigth}</p>
        </div>
    ) 
}

export default Card
